// src/App.js

import React from 'react';

const App = () => {

  return (
    <div style={{display: 'flex', height: '100vh'}}>
      <div style={{flex: 1, backgroundColor: 'red', display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
        <button style={{padding: '1rem'}}>Teams</button>
      </div>
      <div style={{flex: 1, backgroundColor: 'blue', display: 'flex', justifyContent: 'center', alignItems: 'center'}}>
        <button style={{padding: '1rem'}}>Drivers</button>
      </div>
    </div>
  );
};

export default App;
